// import axios from "axios"

import { useEffect,useState } from "react"
import Currency from "./Currency";

const CurrencyRate = () => {

  const[Curren,setCurren]=useState([]);
useEffect(()=>{
  fetch('http://127.0.0.1:8000/api/AllCurrency')
  .then((res)=>res.json())
  .then((data)=>setCurrency(data.data))


});

const AllData=Curren.map((items,index)=><Currency key={index} Mony={items}/>)
  return (


    <div>
      <table className=" table table-primary">
        <thead className="table-danger">
           <tr>
           <th>FirstName</th>
           </tr>
        </thead>
    {AllData}
    </table>
    </div>
  )
}

export default CurrencyRate
